import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

// We import bootstrap to make our application look better.
import "bootstrap/dist/css/bootstrap.css";

// We import NavLink to utilize the react router.
import { NavLink } from "react-router-dom";


export default class Navbar extends Component {

  render() {
    const header = {
      "padding": "1em 0px 0px 2em",
      "font-size": "20px"
    }
    return (
        <nav class="navbar navbar-expand-lg  bg-light">
        <div class="container-fluid">
          <h3 class="display-4">NBA Players Rankings</h3>
          <br/>
            <ul  class="navbar-nav me-auto mb-2 mb-lg-0">
              <NavLink style = {header}  to="/" className="navbar-brand">Vote</NavLink>
              <NavLink style = {header}  to="/rankings" className="navbar-brand">Rankings</NavLink>  
            </ul>
            <span class="navbar-text">
              Ranking the Top 50 players in the NBA
            </span>
          </div>
        </nav>



    );
  }
}
